import React from 'react';
import TopSpace from '../components/common/TopSpace';
import HeaderContainer from '../containers/common/HeaerContainer';
import PostViewerContainer from '../containers/post/PostViewerContainer';
import styled from 'styled-components';
import BottomInfo from '../components/common/BottomInfo';
import SideDrawer from '../components/common/SideDrawer';
import BackgroundBlinder from '../components/common/BackgroundBlinder';

const Spacer = styled.div`
  height: 2rem;
`;

const PostPage = () => {
  return (
    <>
      <HeaderContainer />
      <SideDrawer />
      <BackgroundBlinder />
      <Spacer />
      <TopSpace
        title="대회 정보"
        description="상세 대회 정보 및 참가 작품 목록"
      />
      <PostViewerContainer />
      <BottomInfo />
    </>
  );
};

export default PostPage;
